<style>html{-ms-touch-action:none}body,canvas,div{display:block;outline:0;-webkit-tap-highlight-color:transparent;user-select:none;-moz-user-select:none;-webkit-user-select:none;-ms-user-select:none;-khtml-user-select:none;-webkit-tap-highlight-color:transparent}input::-webkit-inner-spin-button,input::-webkit-outer-spin-button{-webkit-appearance:none;margin:0}body{position:absolute;top:0;left:0;width:100%;height:100%;padding:0;border:0;margin:0;cursor:default;color:#888;background-color:#333;text-align:center;font-family:Helvetica,Verdana,Arial,sans-serif;display:flex;flex-direction:column}canvas{background-color:rgba(0,0,0,0)}#Cocos3dGameContainer,#GameCanvas,#GameDiv{width:100%;height:100%}:root{--safe-top:env(safe-area-inset-top);--safe-right:env(safe-area-inset-right);--safe-bottom:env(safe-area-inset-bottom);--safe-left:env(safe-area-inset-left)}</style>

<body>
  <style>
    html,
    body {
      margin: 0;
      height: 100%;
      background-color: #e2dfdf;
      overflow: hidden;
    }
    #fullpage {
      position: absolute;
      width: 100%;
      height: 100vh;
      display: flex;
      justify-content: center;
      align-items: center;
      background-color: #f3eeee;
      opacity: 1;
      transition: 1s opacity;
    }
    #fullpage.fade-out {
      opacity: 0;
    }
    #loader-container {
      position: absolute;
      width: 100%;
      height: 100vh;
      display: flex;
      justify-content: center;
      align-items: center;
    }
    #loader-background-image {
      width: 15vw;
    }
    .loader {
        display: inline-grid;
        width: 90px;
        aspect-ratio: 1;
        clip-path: polygon(100% 50%, 85.36% 85.36%, 50% 100%, 14.64% 85.36%, 0% 50%, 14.64% 14.64%, 50% 0%, 85.36% 14.64%);
        background: #574951;
        animation: l1 6s infinite linear;
      }
      .loader:before,
      .loader:after {
        content: "";
        grid-area: 1/1;
        background: #83988E;
        clip-path: inherit;
        margin: 10%;
        animation: inherit;
        animation-duration: 12s;
      }
      .loader:after {
        background: #BCDEA5;
        margin: 20%;
        animation-duration: 18s;
      }
      @keyframes l1 {
        to {
          rotate: 1turn
        }
      }
    @media (orientation: portrait) {
      #loader-background-image {
        width: 30vw;
        height: auto;
      }
    }
  </style>
  <div id="GameDiv" cc_exact_fit_screen="true">
    <div id="Cocos3dGameContainer">
      <div id="fullpage">
        <div id="loader-container">
          <div class="loader"></div>
        </div>
      </div>
      <canvas id="GameCanvas" oncontextmenu="event.preventDefault()" tabindex="99"></canvas>
    </div>
  </div>
